import React from "react";
import Books from "./pages/Books";
import Detail from "./pages/Detail";
import NoMatch from "./pages/NoMatch";
import Nav from "./components/Nav";

React.router('/', function(req, res) {

})

function App() {
  return (
    <div>
      <Nav />
      <Books
        title={Books.title}
        author={Books.author}
        synopsis={Books.synopsis}
      />
      <Detail />
      <NoMatch />
    </div>
  );
}

export default App;
